# -*- coding: utf-8 -*-

import datetime

from warnings import warn
from bisect import bisect_right


class Pope:
    def __init__(self, start, end, english_name, regnal_name, personal_name):
        self.start = start
        self.end = end
        self.english_name = english_name
        self.regnal_name = regnal_name
        self.personal_name = personal_name

    def in_inauguration(self, dt):
        start, end = self.start, self.end
        if not start:
            start = datetime.date.min
        if not end:
            end = datetime.date.max
        if isinstance(dt, datetime.datetime):
            return datetime.datetime.combine(start, datetime.datetime.min.time()) <= \
                   dt <= datetime.datetime.combine(end, datetime.datetime.max.time())
        elif isinstance(dt, datetime.date):
            return start <= dt <= end
        else:
            raise TypeError("dt must be an instance of datetime.datetime or datetime.date")

    def __lt__(self, other):
        end = self.end
        if self.end is None:
            if self.start is None:
                return True
            end = self.start
        if isinstance(other, datetime.datetime):
            return datetime.datetime.combine(end, datetime.datetime.max.time()) < other
        elif isinstance(other, datetime.date):
            return end < other
        else:
            raise TypeError("other must be an instance of datetime.datetime or datetime.date")

    def __gt__(self, other):
        start = self.start
        if self.start is None:
            if self.end is None:
                return True
            start = self.end
        if isinstance(other, datetime.datetime):
            return other < datetime.datetime.combine(start, datetime.datetime.min.time())
        elif isinstance(other, datetime.date):
            return other < start
        else:
            raise TypeError("other must be an instance of datetime.datetime or datetime.date")

    def __repr__(self):
        start = self.start.strftime("%d/%m/%Y") if self.start else None
        end = self.end.strftime("%d/%m/%Y") if self.end else None
        return "<Pope: {}, {}-{}>".format(self.english_name, start, end)


