    @classmethod
    def who(cls, dt):
        """
        Returns first matched popet.Pope object with popet.Pope.in_inauguration(dt)
        """
        ind = bisect_right(cls.popes, dt)
        if ind and cls.popes[ind - 1].in_inauguration(dt):
            return cls.popes[ind - 1]
        return None

    @classmethod
    def pope_match(cls, value, key=lambda pope: pope, cmp=lambda pope, value: pope.in_inauguration(value),
                   error="warn"):
        """
        Return all popet.Pope objects stored in self.popes which
        cmp(key(Pope), value) is True.
        if key is not provided, key is lambda pope: pope
        if cmp is not provided, cmp is lambda pope, value: pope.in_inauguration(value)

        error sets error level
            "ignore": ignore all errors occurred while running compare
            "warn": just warn error - default
            "raise": raise any errors

        Default, this will return Pope which in inauguration at given value(which must be datetime.date).
        """
        popes = []
        for pope in cls.popes:
            try:
                if cmp(key(pope), value):
                    popes.append(pope)
            except Exception:
                if error == "warn":
                    warn("There was error running cmp(key(Era), value) but skipped because ignore_error=True")
                elif error == "raise":
                    raise
        return popes
